// Iconset API (Home Assistant 0.110 and up):
async function getIcon(name) {
  return { path: HA_CUST_ICONS_MAP[name] };
}

// Support Icon picker
async function getIconList() {
  return Object.keys(HA_CUST_ICONS_MAP).map(icon => ({name: icon}));
}

// window.customIconsets = window.customIconsets || {};
// window.customIconsets['cust'] = getIcon;

if (!window.frontendVersion || window.frontendVersion < 20200519.0) {
  // old HomeAssistant using legacy icon method (Up to Home Assistant 0.109):
  const iconset = document.createElement("ha-iconset-svg");
  iconset.name = "cust";
  iconset.size = "24";

  let iconsetHTML = '';
  for (let key in HA_CUST_ICONS_MAP) {
    iconsetHTML += `<g id="${key}"><path d="${HA_CUST_ICONS_MAP[key]}" /></g>`;
  }

  iconset.innerHTML = `<svg><defs>${iconsetHTML}</defs></svg>`;
  document.body.appendChild(iconset);
} else if (window.frontendVersion <= 20211027.0){
  // new enough to support customIconsets
  window.customIconsets = window.customIconsets || {};
  window.customIconsets["cust"] = getIcon;
} else {
  // new enough to support getIcon and getIconlist
  window.customIcons = window.customIcons || {};
  window.customIcons["cust"] = { getIcon, getIconList };
}
